BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_administratorzy" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "adm_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "adm_organizacja_id" bigint NULL REFERENCES "rejestr_organizacja" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_czynnosciprzetwarzania" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "czp_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "czp_komorka_id" bigint NULL REFERENCES "rejestr_komorka" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_czynnoscprzetwarzania" (
	"id"	integer NOT NULL,
	"czn_nazwa"	varchar(200) NOT NULL,
	"czn_pozycja_rej"	integer,
	"last_updated"	datetime NOT NULL,
	"czn_status_zatw"	varchar(20),
	"czn_przepis_wrazliwe"	varchar(200) NOT NULL,
	"czn_active"	bool,
	"created"	datetime NOT NULL,
	"czn_zrodlo_danych"	varchar(100),
	"czn_opis_celu"	varchar(200) NOT NULL,
	"OkresRetencji_id"	bigint,
	"Rejestr_id"	bigint,
	"czn_data_obowazywania_do"	date,
	"czn_data_obowazywania_od"	date,
	"czn_data_wyrejestrowania"	date,
	"czn_data_zgloszenia"	date,
	"czn_podstawa_prawna"	varcchar(300),
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("OkresRetencji_id") REFERENCES "rejestr_okresretencji"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("Rejestr_id") REFERENCES "rejestr_rejestr"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "rejestr_grupazabezpieczen" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "gzb_active" bool NOT NULL, "gzb_opis" varchar(300) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_grupazagrozen" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "gzg_active" bool NOT NULL, "gzg_opis" varchar(300) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_iod" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "rejestr_kategoriadanych" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "last_updated" datetime NOT NULL, "kd_dane_szczegolne" bool NOT NULL, "kd_active" bool NOT NULL, "kd_skrot" varchar(100) NOT NULL, "kd_opis" text NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_kategoriaodbiorcow" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "last_updated" datetime NOT NULL, "kto_active" bool NOT NULL, "kto_opis" text NOT NULL, "kto_skrot" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_kategoriaosob" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "last_updated" datetime NOT NULL, "ko_opis" text NOT NULL, "ko_skrot" varchar(100) NOT NULL, "ko_active" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_kategoriedanych" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ktd_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "ktd_dane_id" bigint NULL REFERENCES "rejestr_kategoriadanych" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_kategorieodbiorcow" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "kob_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "kob_odbiorcy_id" bigint NULL REFERENCES "rejestr_kategoriaodbiorcow" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_kategorieosob" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "kos_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "kos_kosoby_id" bigint NULL REFERENCES "rejestr_kategoriaosob" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_komorka" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "kom_adres" varchar(255) NOT NULL, "kom_active" bool NOT NULL, "kom_symbol" varchar(10) NOT NULL, "kom_tel" varchar(100) NOT NULL, "kom_nazwa" varchar(255) NOT NULL, "kom_email" varchar(254) NOT NULL, "last_updated" datetime NOT NULL, "Organizacja_id" bigint NULL REFERENCES "rejestr_organizacja" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_okresretencji" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "okr_nazwa" varchar(255) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL, "okr_opis_okresu" varchar(200) NOT NULL, "okr_active" bool NOT NULL, "okr_lat_max" integer unsigned NULL CHECK ("okr_lat_max" >= 0));
CREATE TABLE IF NOT EXISTS "rejestr_operacjaprzetwarzania" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "opp_active" bool NULL, "opp_opis" varchar(100) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_operacjeprzetwarzania" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "opp_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "opp_operacjap_id" bigint NULL REFERENCES "rejestr_operacjaprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_organizacja" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "org_iod_name" varchar(100) NOT NULL, "org_nazwa" varchar(155) NOT NULL, "org_adres" varchar(100) NOT NULL, "created" datetime NOT NULL, "org_www" varchar(100) NOT NULL, "last_updated" datetime NOT NULL, "org_iod_email" varchar(50) NOT NULL, "org_email" varchar(50) NOT NULL, "org_active" bool NOT NULL, "org_skrot" varchar(30) NOT NULL, "org_tel" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_podatnosc" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "pdt_skrot" varchar(30) NOT NULL, "pdt_opis" varchar(300) NOT NULL, "pdt_active" bool NULL, "pdt_waga" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_podatnosc_Zagrozenia" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "podatnosc_id" bigint NOT NULL REFERENCES "rejestr_podatnosc" ("id") DEFERRABLE INITIALLY DEFERRED, "zagrozenie_id" bigint NOT NULL REFERENCES "rejestr_zagrozenie" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_podmiotprzetwarzajacy" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "prz_active" bool NOT NULL, "prz_skrot" varchar(30) NOT NULL, "prz_nazwa" varchar(155) NOT NULL, "prz_adres" varchar(100) NOT NULL, "prz_email" varchar(50) NOT NULL, "prz_www" varchar(100) NOT NULL, "prz_tel" varchar(100) NOT NULL, "prz_iod_name" varchar(100) NOT NULL, "prz_iod_email" varchar(50) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_podmiotyprzetwarzajace" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "pod_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "pod_organizacja_id" bigint NULL REFERENCES "rejestr_podmiotprzetwarzajacy" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_podstawaprawnaprzetwarzania" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ppw_active" bool NOT NULL, "ppw_skrot" varchar(100) NOT NULL, "ppw_opis" text NOT NULL, "ppw_tresc" varchar(500) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "rejestr_podstawyprawneprzetwarzania" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ppy_czynnosc_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "ppy_podst_id" bigint NULL REFERENCES "rejestr_podstawaprawnaprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_przeslankalegalnosci" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "prl_active" bool NULL, "prl_skrot" varchar(100) NOT NULL, "prl_art_rodo" varchar(100) NOT NULL, "created" datetime NOT NULL, "last_updated" datetime NOT NULL, "prl_przepis_rodo" varchar(500) NULL);
CREATE TABLE IF NOT EXISTS "rejestr_przeslankilegalnosci" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ppl_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "ppl_przeslankap_id" bigint NULL REFERENCES "rejestr_przeslankalegalnosci" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "rejestr_rejestr" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "rej_opis" text NOT NULL, "rej_active" bool NOT NULL, "last_updated" datetime NOT NULL, "created" datetime NOT NULL, "rej_zakres" varchar(30) NOT NULL, "rej_nazwa" varchar(200) NOT NULL, "Organizacja_id" bigint NULL REFERENCES "rejestr_organizacja" ("id") DEFERRABLE INITIALLY DEFERRED);
