CREATE TABLE IF NOT EXISTS "rejestr_ryzyko_Zabezpieczenia" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "ryzyko_id" bigint NOT NULL REFERENCES "rejestr_ryzyko" ("id") DEFERRABLE INITIALLY DEFERRED, "zabezpieczenie_id" bigint NOT NULL REFERENCES "rejestr_zabezpieczenie" ("id") DEFERRABLE INITIALLY DEFERRED);
