CREATE TABLE IF NOT EXISTS "rejestr_sposobyprzetwarzania" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "spp_czynnoscp_id" bigint NULL REFERENCES "rejestr_czynnoscprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED, "spp_sposobp_id" bigint NULL REFERENCES "rejestr_sposobprzetwarzania" ("id") DEFERRABLE INITIALLY DEFERRED);
